Inclusive não se esqueça que duas vezes ele se lesionou pq colocaram ele pra jogar no sacrifício antes do tempo.
Só reparar que ele botou a mão no posterior de coxa as duas vezes depois de arrancadas, pra simplificar é como se o corpo dele quisesse arrancar mas a musculatura limitou o movimento e se rompe, talvez o trabalho de hipertrofia tenha encurtado o musculo.

